function createGeneratedItem(THREE) {
	const group = new THREE.Group();

	// --- Materials ---
	// We use flatShading to achieve the distinct faceted, low-poly aesthetic.
	// MeshStandardMaterial provides more realistic lighting than Lambert.
	const metalMaterial = new THREE.MeshStandardMaterial({
		color: 0x8D9196, // A metallic grey, sampled from the target image
		metalness: 0.8,
		roughness: 0.5,
		flatShading: true,
	});

	const leatherMaterial = new THREE.MeshStandardMaterial({
		color: 0x855B49, // A rich brown for the leather grip
		roughness: 0.9,
		flatShading: true,
	});

	// --- Blade ---
	// The blade requires a custom geometry to create the central ridge (fuller),
	// the taper, and the sharp point, which isn't possible with basic shapes.
	const bladeGeom = new THREE.BufferGeometry();

	// Define blade dimensions
	const bladeWidth = 1.6;
	const bladeLength = 6.5;
	const bladeFullerDepth = 0.15; // Depth of the central ridge

	// Define the vertices (points) of the blade in 3D space [x, y, z]
	const bladeVertices = new Float32Array([
		// Top edge where it meets the guard
		-bladeWidth / 2, 0, 0, // 0: Top-left corner
		 bladeWidth / 2, 0, 0, // 1: Top-right corner
		 0, 0,  bladeFullerDepth, // 2: Top-center front (for the ridge)
		 0, 0, -bladeFullerDepth, // 3: Top-center back (for the ridge)

		// The tip of the sword
		 0, -bladeLength, 0, // 4: Pointy tip
	]);

	// Define the faces (triangles) by connecting the vertices using their indices.
	// Each triplet of indices forms one triangle.
	const bladeIndices = [
		// Front face (two triangles creating a kite shape)
		0, 4, 2, // Left-front triangle
		2, 4, 1, // Right-front triangle
		// Back face
		1, 4, 3, // Right-back triangle
		3, 4, 0, // Left-back triangle
		// Top edge (to cap the blade)
		0, 2, 1,
		0, 1, 3
	];

	bladeGeom.setIndex(bladeIndices);
	bladeGeom.setAttribute('position', new THREE.BufferAttribute(bladeVertices, 3));
	bladeGeom.computeVertexNormals(); // Essential for correct lighting

	const blade = new THREE.Mesh(bladeGeom, metalMaterial);
	// Position the blade to start just below the crossguard's center.
	blade.position.y = -0.4;
	group.add(blade);


	// --- Crossguard ---
	// The crossguard also uses a custom geometry for its unique swept-wing shape.
	const crossguardGeom = new THREE.BufferGeometry();

	// Define crossguard dimensions
	const cgWidth = 3.8;    // Total width from tip to tip
	const cgHeight = 0.7;   // Thickness at the center
	const cgDepth = 0.8;    // Depth at the center
	const cgCenterWidth = 1.0; // Width of the flat central part

	const cgVertices = new Float32Array([
		// Define the 10 key vertices for the crossguard shape
		// Outer points
		-cgWidth / 2, 0, 0, // 0: Left tip
		 cgWidth / 2, 0, 0, // 1: Right tip
		// Top-center quad
		-cgCenterWidth / 2,  cgHeight / 2,  cgDepth / 2, // 2: Top-front-left
		 cgCenterWidth / 2,  cgHeight / 2,  cgDepth / 2, // 3: Top-front-right
		-cgCenterWidth / 2,  cgHeight / 2, -cgDepth / 2, // 4: Top-back-left
		 cgCenterWidth / 2,  cgHeight / 2, -cgDepth / 2, // 5: Top-back-right
		// Bottom-center quad
		-cgCenterWidth / 2, -cgHeight / 2,  cgDepth / 2, // 6: Bottom-front-left
		 cgCenterWidth / 2, -cgHeight / 2,  cgDepth / 2, // 7: Bottom-front-right
		-cgCenterWidth / 2, -cgHeight / 2, -cgDepth / 2, // 8: Bottom-back-left
		 cgCenterWidth / 2, -cgHeight / 2, -cgDepth / 2, // 9: Bottom-back-right
	]);

	const cgIndices = [
		// Build the faces by connecting the vertices
		// Top surface
		0, 4, 2,  // Left wing
		1, 3, 5,  // Right wing
		2, 4, 5,  2, 5, 3, // Center plane
		// Bottom surface
		0, 6, 8,  // Left wing
		1, 9, 7,  // Right wing
		6, 9, 8,  6, 7, 9, // Center plane
		// Front faces
		0, 2, 6,  // Left wing front
		1, 7, 3,  // Right wing front
		2, 7, 6,  2, 3, 7, // Center front
		// Back faces
		0, 8, 4,  // Left wing back
		1, 5, 9,  // Right wing back
		4, 8, 9,  4, 9, 5  // Center back
	];

	crossguardGeom.setIndex(cgIndices);
	crossguardGeom.setAttribute('position', new THREE.BufferAttribute(cgVertices, 3));
	crossguardGeom.computeVertexNormals();

	const crossguard = new THREE.Mesh(crossguardGeom, metalMaterial);
	// The crossguard is the center of our object, so it's at the group's origin.
	group.add(crossguard);


	// --- Hilt (Grip) ---
	// An 8-sided cylinder is a perfect primitive for a faceted, wrapped grip.
	const hiltHeight = 3.0;
	const hiltRadius = 0.4;
	const hiltGeom = new THREE.CylinderGeometry(hiltRadius, hiltRadius, hiltHeight, 8);
	const hilt = new THREE.Mesh(hiltGeom, leatherMaterial);
	// Stack the hilt on top of the crossguard.
	hilt.position.y = cgHeight / 2 + hiltHeight / 2;
	group.add(hilt);


	// --- Pommel ---
	// An Icosahedron is a 20-sided polyhedron that looks like a faceted sphere.
	// Setting detail to 0 gives the classic D20 shape.
	const pommelRadius = 0.7;
	const pommelGeom = new THREE.IcosahedronGeometry(pommelRadius, 0);
	const pommel = new THREE.Mesh(pommelGeom, metalMaterial);
	// Stack the pommel on top of the hilt.
	pommel.position.y = hilt.position.y + hiltHeight / 2;
	group.add(pommel);

	// Apply the overall scale from the original code.
	const scale = 0.25;
	group.scale.set(scale, scale, scale);

	return group;
}
